import React from 'react';
import ROOMS_JSON from './../../JSON/room-images.json';

export const PhotoCarousel = () => {


  const mapRooms = () => {
    const imagePath = process.env.PUBLIC_URL + ROOMS_JSON.find(room => room.name === 'Foto Carosello').images[0];

    return (
      <div className="carousel-item">
        <img src={imagePath} className="d-block w-100" alt="Stanza Gialla" />
      </div>
    );
  };


  return (
    {
      mapRooms
    }
  );
}
